export default function ColorsFontsPage({ formData, updateFormData, skipPage }: Props) {
  const colorsData = formData.colorsFonts || {};

  const handleInputChange = (field: keyof ColorsFonts, value: string | boolean) => {
    updateFormData('colorsFonts', { [field]: value });
  };

  const handleCustomColorChange = (colorType: string, value: string) => {
    const currentCustomColors = colorsData.customColors || {};
    updateFormData('colorsFonts', {
      customColors: {
        ...currentCustomColors,
        [colorType]: value
      }
    });
  };

  const getSelectedTheme = () => {
    return colorPalettes.find(palette => palette.id === colorsData.selectedTheme);
  };

  const getColorValue = (colorType: string) => {
    const customColors = colorsData.customColors || {};
    if (customColors[colorType]) {
      return customColors[colorType];
    }
    const selectedTheme = getSelectedTheme();
    if (selectedTheme) {
      const color = selectedTheme.colors.find(c => c.id === colorType);
      return color ? color.value : '#000000';
    }
    return '#000000';
  };

  return (
    <div className="space-y-8">
      <div className="text-center">
        <h2 className="text-2xl font-bold text-gray-900 mb-2">Colors & Fonts</h2>
        <p className="text-gray-600">Choose your preferred color palette and typography theme</p>
      </div>

      {/* AI Decide Option */}
      <div className="bg-white p-6 rounded-lg border">
        <div className="flex items-center space-x-3">
          <input
            type="checkbox"
            id="aiDecide"
            checked={colorsData.aiDecide || false}
            onChange={(e) => handleInputChange('aiDecide', e.target.checked)}
            className="rounded border-gray-300 text-blue-600 focus:ring-blue-500"
          />
          <label htmlFor="aiDecide" className="text-lg font-medium text-gray-900">
            Let the AI decide these for me
          </label>
        </div>
        <p className="text-gray-600 mt-2 ml-6">
          Our AI will analyze your project requirements and select the most suitable color palette and typography theme.
        </p>
      </div>

      {/* Theme Selection */}
      {!colorsData.aiDecide && (
        <div className="bg-white p-6 rounded-lg border">
          <h3 className="text-lg font-semibold mb-4">Choose Your Theme</h3>
          <p className="text-gray-600 mb-6">Select a color palette that matches your project's style and personality:</p>

          <div className="grid grid-cols-1 md:grid-cols-2 lg:grid-cols-3 gap-4">
            {colorPalettes.map((palette) => (
              <div
                key={palette.id}
                className={`border-2 rounded-lg p-4 cursor-pointer transition-all hover:shadow-md ${
                  colorsData.selectedTheme === palette.id
                    ? 'border-blue-500 bg-blue-50'
                    : 'border-gray-200 hover:border-gray-300'
                }`}
                onClick={() => handleInputChange('selectedTheme', palette.id)}
              >
                <div className="flex items-center justify-between mb-3">
                  <h4 className="font-semibold text-gray-900">{palette.name}</h4>
                  <input
                    type="radio"
                    name="theme"
                    value={palette.id}
                    checked={colorsData.selectedTheme === palette.id}
                    onChange={() => handleInputChange('selectedTheme', palette.id)}
                    className="text-blue-600 focus:ring-blue-500"
                  />
                </div>

                <p className="text-sm text-gray-600 mb-3">{palette.description}</p>

                {/* Color Preview */}
                <div className="space-y-2">
                  {palette.colors.map((color) => (
                    <div key={color.id} className="flex items-center space-x-2">
                      <div
                        className="w-4 h-4 rounded border border-gray-300"
                        style={{ backgroundColor: color.value }}
                      />
                      <span className="text-xs text-gray-500">{color.label}</span>
                    </div>
                  ))}
                </div>
              </div>
            ))}
          </div>
        </div>
      )}

      {/* Skip Option */}
      <div className="bg-yellow-50 border border-yellow-200 rounded-lg p-4 flex flex-col md:flex-row md:items-center md:justify-between">
        <span className="text-yellow-700 text-sm mb-2 md:mb-0">If this section does not apply, you can skip it.</span>
        <button
          onClick={skipPage}
          className="px-4 py-2 bg-orange-500 text-white rounded-md hover:bg-orange-600 transition-colors w-full md:w-auto"
        >
          Save & Skip
        </button>
      </div>
    </div>
  );
}
